import React, { useState } from "react";

const AuthContext = React.createContext({
    isLoggedIn: false,
    onLogout: () => {}
});


export const AuthContextProvider = props => {
    return <AuthContextProvider>{props.children}</AuthContextProvider>
};

export default AuthContext;
